import React, { Component } from 'react';
import './App.css';

import {Route} from 'react-router-dom';

//import LoginModal from './components/LoginModal';
//import SignUpModal from './components/SignUpModal';
//import UserTypeSelection from './components/UserTypeSelection';
//import ListviewComponent from './components/ListviewComponent';
//import GridviewComponent from './components/GridviewComponent';
import Header from './components/Header';
import RegistrationPage from './views/RegistrationPage'
import LoginModal from './components/LoginModal';
import CoordinatorHome from './views/CoordiantorHome';
import DonorHome from './views/DonorHome';
//import StoryViewDonor from './components/StoryViewDonor';
//<Route exact path='/home/donor/story/:id' component={StoryViewDonor} />

import StoryViewDonorTest from './components/StoryViewDonorTest';
import StoryViewCoordinator from './components/StoryViewCoordinator';
import NewStory from './components/NewStory';


class App extends Component {
  render() {
    return (
      <div className="App">
        <Route path='/' component={ (props) => (<Header timestamp={new Date().toString()} {...props} />)}/>
        <Route path='/register' component={RegistrationPage}/>
        <Route path='/login' component={LoginModal} />
        <Route path='/home/coordinator' component={CoordinatorHome} />
        <Route path='/home/donor' component={DonorHome} />
        <Route path='/home/donor/story/:id' component={StoryViewDonorTest} />
        <Route path='/home/coordinator/story/:id' component={StoryViewCoordinator} />
        <Route path='/home/coordinator/new' component={NewStory} />
      </div>
    );
  }
}

export default App;
